import { useParams } from "react-router-dom";
import { useEffect } from "react";
import { baseUrl } from "../api";
import axios from "axios";

export default function DashBoard() {
  let { email } = useParams();

  useEffect(() => {
    async function getData() {
      await axios.get(`${baseUrl}/gettodo`);
    }
  }, []);
  return (
    <div>
      <h1>{email}</h1>
    </div>
  );
}
